import Link from 'next/link'

const blogOperations = ['add','update','delete']

export default BlogHeader = (props) => {
    return (
        <div>
            <ul>
                {blogOperations.map((operation,index) => {
                    return (
                        <li key={index}>
                            <Link href='/operation/[operation]' as={`/operation/${operation}`}>
                                <a>{operation}</a>
                            </Link>
                        </li>
                    )
                })}
            </ul>
        </div>
    )
}
